import PJListItem from 'components/PJListItem';
import { latestPListMock } from 'mocks';
import './App.css';

function App() {
  return (
    <>
      {latestPListMock.map((pListItem) => (
        <PJListItem pListItem={pListItem} />
      ))}
    </>
  );
}

export default App;
